import React from 'react';
import LineChartV from './src/LineChart';
import RadarChartV from './src/RadarChart';

function App() {
  return (
    <div style={{background:'#eee',display:'flex'}} >

     <div style={{width:'600px',background:'white',borderRadius:'5px',margin:'5px'}}>
     <LineChartV />
     </div>
     <div style={{width:'600px',background:'white',borderRadius:'5px'}}>
     <RadarChartV/>
     </div>

    </div>
  );
}

export default App;
